import Cardlist from './Cardlist';
import {Artwork} from './Artwork';
import Searchbox from './Searchbox';


const App = () => {
  return (
      <div className= 'tc'>
        <h1> Lubna Calligraphy </h1>
        <Searchbox /> 
        <Cardlist Artwork={Artwork} />
      </div>
    );
}

export default App;
